import React, { Component } from 'react';

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            items: [],
            isLoaded: false
        }
    }

    componentDidMount() {
        fetch("https://www.bitstamp.net/api/v2/trading-pairs-info")
            .then(response => response.json())
            .then(data => this.setState({ data }));
    }

    render() {
        return <h1>Pepega</h1>
    };
}

export default App;
